import {
    Redirect,
    Routes,
    Route
} from "react-router-dom";

const AppRouter = () => {
   return (
    <Routes>
       {user.isAuth && authRoutes.map(({patch, Component}) =>
            <Route key = {patch}  path={patch} element={<Component/>} exact/>
        )}
        {publicRoutes.map(({patch , Component}) =>
            <Route key = {patch} path = {patch} element={<Component/>} exact/>
        )}
        <Route path = "*" element={<Shop/>}/>
    </Routes>
   )
   
};
export default AppRouter;
